import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [formData, setFormData] = useState({
        Age: '',
        Sex: '',
        ChestPainType: '',
        RestingBP: '',
        Cholesterol: '',
        FastingBS: '',
        RestingECG: '',
        MaxHR: '',
        ExerciseAngina: '',
        Oldpeak: '',
        ST_Slope: '',
  });
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

  // Convert strings to numbers
  const processedData = {
    Age: parseInt(formData.Age),
    Sex: parseInt(formData.Sex),
    ChestPainType: parseInt(formData.ChestPainType),
    RestingBP: parseInt(formData.RestingBP),
    Cholesterol: parseInt(formData.Cholesterol),
    FastingBS: parseInt(formData.FastingBS),
    RestingECG: parseInt(formData.RestingECG),
    MaxHR: parseInt(formData.MaxHR),
    ExerciseAngina: parseInt(formData.ExerciseAngina),
    Oldpeak: parseInt(formData.Oldpeak),
    ST_Slope: parseInt(formData.ST_Slope),
    // Convert other numeric fields
  };

  try {
    const response = await axios.post('http://localhost:8000/predict', processedData);
    setPrediction(response.data);
  } catch (error) {
    console.error('Error:', error.response?.data);
    console.error('Data sent:', processedData); 
  }

  setLoading(false);
};

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <div className="App">
      <h1>Heart Disease Prediction</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Age:</label>
          <input
            type="number"
            name="age"
            value={formData.age}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Sex:</label>
          <input
            type="number"
            name="Sex"
            value={formData.Sex}
            onChange={handleChange}
            required
          />
        </div>
          <label>ChestPainType:</label>
          <input
            type="number"
            name="ChestPainType"
            value={formData.ChestPainType}
            onChange={handleChange}
            required
          />
          <label>RestingBp:</label>
          <input
            type="number"
            name="RestingBp"
            value={formData.RestingBp}
            onChange={handleChange}
            required
          />
          <label>Cholesterol:</label>
          <input
            type="number"
            name="Cholesterol"
            value={formData.Cholesterol}
            onChange={handleChange}
            required
          />
          <label>FastingBS:</label>
          <input
            type="number"
            name="FastingBS"
            value={formData.FastingBS}
            onChange={handleChange}
            required
          />
          <label>RestingECG:</label>
          <input
            type="number"
            name="RestingECG"
            value={formData.RestingECG}
            onChange={handleChange}
            required
          />
          <label>MaxHR:</label>
          <input
            type="number"
            name="MaxHR"
            value={formData.MaxHR}
            onChange={handleChange}
            required
          />
          <label>ExerciseAngina:</label>
          <input
            type="number"
            name="ExerciseAngina"
            value={formData.ExerciseAngina}
            onChange={handleChange}
            required
          />
          <label>Oldpeak:</label>
          <input
            type="number"
            name="Oldpeak"
            value={formData.Oldpeak}
            onChange={handleChange}
            required
          />
          <label>ST_Slope:</label>
          <input
            type="number"
            name="ST_Slope"
            value={formData.ST_Slope}
            onChange={handleChange}
            required
          />
        <button type="submit" disabled={loading}>
          {loading ? 'Predicting...' : 'Predict'}
        </button>
      </form>

      {prediction && (
        <div>
          <h2>Results:</h2>
          <p>Prediction: {prediction.prediction}</p>
        </div>
      )}
    </div>
  );
}

export default App;
